description:
Le contrat de ville est le cadre d'actions de la politique de la ville, issude la loi "Ville et Cohésion Urbaine" du 21 février 2014, en faveur de 1 514 quartiers prioritaires au niveau national dont **105 en Région Occitanie.**
Conclu à l’échelle intercommunale pour six ans, les 39 contrats de ville de la Région Occitanie reposent sur trois axes d’action :
  * **la cohésion sociale** : le contrat prévoit des mesures de soutien aux équipements sociaux, culturels, sportifs et aux associations pour favoriser le lien social sur le territoire ;
  * **le cadre de vie** et le renouvellement urbain : il programme la création d’équipements, la mobilité dans le parc résidentiel ou encore la mise en place de nouvelles activités ;
  * **le développement économique et l’emploi** : le contrat de ville assure notamment la présence de Pôle emploi et des missions locales dans chacun des territoires prioritaires.
Ce jeu de données présente **les 48 communes de la Région Occitanie concernées par un contrat de ville.**

Déclaration du profil d'acheteur Lycée Jean Paul de Rocca serra à Porto-Vecchio.
EPLE comptant 800 élèves 120 personnels; 
EPLE comportant un internat.

Le site officiel de l'administration française service-public.fr référence une soixantaine de simulateurs disponibles pour répondre à un large éventail de questions administratives qui se posent aux particuliers et aux professionnels. Certains de ces simulateurs ont été développés par la Direction de l'information légale et administrative (DILA), dont le [simulateur CALENDRIER DES VACANCES SCOLAIRES](https://www.service-public.fr/particuliers/vosdroits/R51836).
Ce simulateur permet de connaître les dates des vacances scolaires qui dépendent de la zone (en métropole ou sur les territoires d’outre-mer) dans laquelle se trouve l'établissement (école maternelle ou primaire, collège ou lycée).  A partir de la saisie d’un département et du choix du calendrier souhaité, les dates de l’ensemble des vacances de l’année scolaire (Toussaint, Noël, hiver, Pâques et été) sont restituées.
Le simulateur propose le téléchargement d’un fichier permettant d’intégrer ces dates sur un agenda électronique.
Les données du simulateur sont mises à jour en fonction des évolutions de la règlementation.
Les simulateurs développés par la DILA utilisent le moteur de simulation G6K dont les sources sont accessibles via le lien : https://github.com/eureka2/G6K. **Merci de noter que ces sources sont incompatibles avec les données du simulateur de cette page. Une mise à jour sera  disponible avant la fin de l'année 2024.**   
Outre les sources, sont à disposition via ce lien :
- La définition (étapes, règles,.), au format XSD, valable pour tous les simulateurs développés avec le moteur G6K ;
- La procédure de mise à disposition et d’installation du moteur.
Les données du simulateur mises à disposition par la DILA sont constituées :
•  d’une présentation du simulateur au format PDF ;
•  d’un fichier XML présentant les règles de calcul du simulateur ;
•  d'une feuille de style au format  CSS ;
•  des données de référence  au format  JSON ; 
•  d’un schéma des données de référence au format SCHEMA.JSON.

