Le site officiel de l'administration française [service-public.fr](https://www.service-public.fr) référence une soixantaine de simulateurs disponibles pour répondre à un large éventail de questions administratives qui se posent aux particuliers et aux professionnels. Certains de ces simulateurs ont été développés par la Direction de l'information légale et administrative (DILA), dont le [simulateur des FRAIS DE MISE EN LOCATION IMPUTABLES AU LOCATAIRE](https://www.service-public.fr/particuliers/vosdroits/R49129).
Ce simulateur permet de connaître la zone géographique dont dépend le logement concerné pour estimer les frais de mise en location imputables au locataire.
Le résultat obtenu (zone très tendue, zone tendue, reste du territoire) détermine le prix maximum TTC par m2 de surface habitable qui peut être demandé au locataire pour rémunérer les services de l’agent immobilier lors de la mise en location (hors état des lieux) : visite du logement, constitution du dossier du locataire et rédaction du contrat de bail.
