Le site officiel de l'administration française [service-public.fr](https://www.service-public.fr) référence une soixantaine de simulateurs disponibles pour répondre à un large éventail de questions administratives qui se posent aux particuliers et aux professionnels. Certains de ces simulateurs ont été développés par la Direction de l'information légale et administrative (DILA), dont le [simulateur des ZONES TENDUES](https://www.service-public.fr/particuliers/vosdroits/R49131).
Ce simulateur permet de déterminer si un logement est situé en zone tendue.
La zone détermine :
• terrain nu : le droit à l’exonération de la taxe foncière sur les propriétés non bâties ;
• logement vacant : l’application de la taxe sur les logements vacants applicable à certaines communes (TLV) ;
• logement loué ;
• le droit à un préavis d’1 mois pour le locataire (logement vide ou loi 1948) ;
• l’application de l’encadrement des loyers (logement vide ou meublé).
Les données du simulateur sont mises à jour en fonction des évolutions de la règlementation.
