Le site officiel de l'administration française [service-public.fr](https://www.service-public.fr) référence une soixantaine de simulateurs disponibles pour répondre à un large éventail de questions administratives qui se posent aux particuliers et aux professionnels. Certains de ces simulateurs ont été développés par la Direction de l'information légale et administrative (DILA), dont le [simulateur pour Connaître la zone de sa commune : A, A bis, B1, B2 ou C](https://www.service-public.gouv.fr/particuliers/vosdroits/R46110).
Ce simulateur permet de connaître le type de zone (A, A bis, B1, B2 ou C) dont dépend le logement concerné.
La zone détermine :
• le revenu maximum pour avoir droit à un [logement social](https://www.service-public.gouv.fr/particuliers/vosdroits/F869) (HLM) sauf en Outre mer ;
• pour un bailleur (bail d'habitation), le droit à une [réduction d’impôt](https://www.service-public.gouv.fr/particuliers/vosdroits/F31151) et les plafonds des loyers (dispositif Pinel à partir du 1er octobre 2014) ;
• pour le bailleur d'un logement conventionné avec l'Anah : le droit à une [déduction fiscale sur les revenus fonciers](https://www.service-public.gouv.fr/particuliers/vosdroits/F34115) , le [revenu maximum du futur locataire](https://www.service-public.gouv.fr/particuliers/vosdroits/F1626) sauf en Outre-mer, le [loyer initial maximum](https://www.service-public.gouv.fr/particuliers/vosdroits/F2541).
A noter : La liste des communes a été modifiée par l'[arrêté du 5 septembre 2025](https://www.legifrance.gouv.fr/jorf/id/JORFTEXT000052198878).
Les données du simulateur sont mises à jour en fonction des évolutions de la règlementation.
Les simulateurs développés par la DILA utilisent le moteur de simulation G6K dont les sources sont accessibles via le lien : <https://github.com/eureka2/G6K>.
Outre les sources, sont à disposition via ce lien :
* La définition (étapes, règles,.), au format XSD, valable pour tous les simulateurs développés avec le moteur G6K ;
* La procédure de mise à disposition et d’installation du moteur.
Les données du simulateur mises à disposition par la DILA sont constituées :
* d’une présentation du simulateur (PDF) ;
* des règles de calcul du simulateur (XML) ;
* d’une feuille de style (CSS) ;
* des données de référence (JSON) ;
* d’un schéma des données de référence (Schéma JSON).

