17)	Incorporation dans le domaine privé puis public communal des voiries et réseaux divers de la Cité 7 – 2ème partie : rues : La Fontaine, Piétonnier (entre AE-243 et 244), Piétonnier (entre AE-234 et 236), Rue entre La Fontaine et Montesquieu), Chateaubriand, Montesquieu, Boileau, Pascal, Molière, Thiers, Buffon et piétonnier (rue Boileau) ;
